import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import { Home } from "./pages/home/Home";

function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route path="/" element={<Home/>} />
      </Switch>
    </BrowserRouter>
  );
}

export default App;
